// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./DAO.sol";
import "./CRUD.sol";
import "./DAOToken.sol";

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";


contract DAOFactory is Initializable, UUPSUpgradeable, OwnableUpgradeable {

    address public initiator;  // Offchain initiator
    uint daoCount;
    CRUD daos; 

    mapping(address => string) daoToCeramic;
    modifier initiatorOnly {require(msg.sender == initiator); _;}

    event NewDao(string name, address indexed dao);
    event NewDeposit(uint daoId, address sender, uint deposit);

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    function setup(address _new_initiator) public onlyOwner {
        if (_new_initiator != address(0x0)) {
            initiator = _new_initiator;
        }
    }

    // ToDo is it safe to make initial function public?
    function initialize(address _initiator) public initializer {
        //owner = _owner;
        initiator = _initiator;
        daos = new CRUD();
    }

    function new_dao(string memory _DAOname, 
                    string memory _ticker, 
                    uint _shares_amount) public payable returns(address) {
        daoCount++;
        //  Building the brand new DAO.
        DAO dao = new DAO();
        // Create DAO and the pool inside of it.
        dao.initialize(_DAOname, _ticker, _shares_amount);
        dao.recieveDeposit(msg.sender);
        // Send eth to the pool.
        address daoAddr = address(dao);
        // Add dao addres and dao ID to dynamic array.
        daos.create(daoCount, daoAddr);
        emit NewDao(_DAOname, daoAddr);
        return daoAddr;
    }

    function delegateToCeramic(address _daoAddress) public view returns(string memory) {
        return daoToCeramic[_daoAddress];
    }

    function getDao(uint _id) public view returns (address) {
        return daos.read(_id);
    }

    function delDao(uint _id) public initiatorOnly {
        daos.del(_id);
    }

    function getAllDaos() public view returns (CRUD.Instance[] memory){
        return daos.readAll();
    }
}

contracts/DAO.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./DAOToken.sol";
import "./CRUD.sol";

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
//import "@openzeppelin/contracts-upgradeable/token/ERC721/IERC721Upgradeable.sol";
//import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";



contract DAO is Initializable, OwnableUpgradeable, UUPSUpgradeable {
    /* 
    Right now there are 2 stages of funding process:
    */ 
    // cбор, сбор закончен, сбор отменен
    enum Stages{ IN_PROGRESS, FULL }

    struct Vault {
        mapping(address => bool) assetLocked;
        address[] erc20;  // Locked ERC20
    }

    CRUD users = new CRUD();
    mapping(address => uint) userToEth;
    mapping(address => uint) stakes; 
    Vault vault;
    Stages public stage = Stages.IN_PROGRESS;
    DAOToken daoToken;
    uint userCount;
    uint total;

    modifier onlyFull() { require(stage ==  Stages.FULL); _; }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    function initialize (string memory _name, string memory _ticker, 
                        uint _shares_amount) public initializer {
        // Get DAO token.
        // Tokens are minted automatically after the contract initialization.
        daoToken = new DAOToken();
        daoToken.initialize(
                _name,
                _ticker,
                _shares_amount,  // ToDo initialize: We should discuss the amount of minted shares.
                address(this));
        // Get token address.
        address tokenAddress = address(daoToken);   
        //Add asset to the list of all assets.
        addErc20Asset(tokenAddress);
    }

    function recieveDeposit(address _user) public payable {
        userCount++;
        // Add the user address to the dynamic array of users.
        users.create(userCount, _user);
        // Update user stats.
        userToEth[_user] += msg.value; 
    }

    function getTokenAddress() public view returns(address){
        return address(daoToken);
    }

    function getUserDeposit(address _user) public view returns(uint) {
        return userToEth[_user];
    }

    function getBalance() public view returns (uint){
        return address(this).balance;
    }

    function stake(uint _amount, address stake_for, 
                    address _user) public onlyFull {
        if (daoToken.allowance(_user, address(this)) < _amount) {
            daoToken.approve(address(this), _amount);
        }
        daoToken.transferFrom(_user, address(this), _amount);
        stakes[stake_for] += _amount;
    }

    function auto_stake(uint _amount, address _stake_for) public onlyFull {
        //daoToken.transferFrom(address(pool_contract), address(this), _amount);
        stakes[_stake_for] += _amount;
    }

    function get_stake(address _user) public view onlyFull returns (uint){
        return stakes[_user];
    }

    function claim(uint _amount, address _user) public {  // 50
        uint userStake = stakes[_user];  // 2
        if (userStake < _amount) {  // 2*50 < 50
            daoToken.transfer(_user, userStake);
        } else {
            daoToken.transfer(_user, _amount);
            }
    }

    function addErc20Asset(address _assetAddress) public onlyOwner {  
        require(vault.assetLocked[_assetAddress] == false, 
        "This asset is already locked");
        vault.erc20.push(_assetAddress);
        vault.assetLocked[_assetAddress] = true;
    }

    function getErc20Assets() public view returns(address[] memory) {
        /*
        Get locked assets. UI should iterate over them checking the owner is this DAO
        */
        return vault.erc20;
    }

    // Will be refactored
    /*
    function distributeDaoTokens() public onlyFull onlyOwner {
        uint k = daoToken.totalSupply() / parties[_partyId].totalDeposit;
        Party storage party = parties[_partyId];
        _daoToken.approve(_daoAddress, _daoToken.totalSupply());
        for (uint i = 0; i < parties[_partyId].participants.length; i++) {
            address recipient = party.participants[i];
            dao.auto_stake(shares[_partyId][recipient]*k, recipient);
            userToDaos[recipient].push(_daoAddress);
        }
    }*/

    function nextStage() internal {
        stage = Stages(uint(stage) + 1);
    }
}

